import React, { useState } from 'react';
import { Link, NavLink, Outlet } from 'react-router-dom';

const Contacts = () => {

    const [contacts, setcontacts] = useState([
        {
            name: 'abdelbasset babeler',
            phone: '0658484674',
            email: 'abdelbasset@gmail.com',
        },
        {
            name: 'abdelbasset babeler',
            phone: '0658484674',
            email: 'abdelbasset@gmail.com',
        },
        {
            name: 'abdelbasset babeler',
            phone: '0658484674',
            email: 'abdelbasset@gmail.com',
        },
    ]);

    return (
        <div>
            Contact Page
            <div>
                <Link to={'displayContacts'}>
                    <button>Display Connects </button>
                </Link>
                <Link to={'createContacts'}>
                    <button>Create Connects </button>
                </Link>

            </div>
            <div className='navigationWrapper'>
                <NavLink
                    className='navlink'
                    to="displayContacts"
                    style={({ isActive }) =>
                        isActive ? activeStyle : undefined
                    }
                >
                    Display Connects
                </NavLink>
                <NavLink
                    className='navlink'
                    to="createContacts"
                    style={({ isActive }) =>
                        isActive ? activeStyle : undefined
                    }
                >
                    Create Blogs
                </NavLink>
            </div>

            <div className='outile'>
                <Outlet context={[contacts, setcontacts]} />
            </div>
        </div>
    );
}

export default Contacts;
